  if (o.getClass() != RenewAction.class) {
    throw new IllegalArgumentException("Illegal comparision to non-RenewAction");
  }
  RenewAction other = (RenewAction) o;
  return timestamp < other.timestamp ? -1 :
    (timestamp == other.timestamp ? 0 : 1);
}

